import React from 'react';


function Hello() {
return (
<div className="shopping-list">

<h1>Shopping List for {this.props.Name}</h1>
<ul>
   <li>Instagram</li>
   <li>WhatsApp</li>
   <li>Oculus</li>
 </ul>
</div>
)
}

export default Hello;
